import React from 'react';
import './FotOne.css';
import logo from '../images/logo.svg';

export default class FoOne extends React.Component {
  render() {
    return (
      <div className='fotone'>
        <div className='fot'>
          <span>
            <img src={logo} />
          </span>
          <div className='fot2'>
            <p>Affiliate</p>
            <p>Entreprise</p>
            <p>Products</p>
            <p></p>
          </div>
        </div>
      </div>
    );
  }
}
